import React, { Component} from 'react'
import { Image, Cut } from 'react-image-selector'; 

    class Payment extends Component{
    
    render () {
        return (
        <div>
        <Image responsive={true}>
            <Cut
                width={200}
                height={400}
                src="/path/to/image.jpg"
                at2x="/path/to/retina/image.jpg"
            />
            <Cut
                width={400}
                height={800}
                src="/path/to/image.jpg"
                at2x="/path/to/retina/image.jpg"
            />
        </Image>
        </div>
        )
    }
}
export default Payment
